import HowItWorks from './components/HowItWorks';
import Quiz from './components/Quiz';
import Footer from './components/Footer';
import ExitIntentPopup from './components/ExitIntentPopup';
import './index.css';

function App() {
  return (
    <div className="App">
      <Hero />
      <Quiz />
      <ProblemSolution />
      <ExperiencesShowcase />
      <HowItWorks />
      <SocialProof />
      <Footer />
    </div>
  );
}

export default App;
